import sys
import unittest
import libsbml


class TestGetValue(unittest.TestCase):


  def test_getValue_constant_e(self):
    n = libsbml.readMathMLFromString("<math xmlns='http://www.w3.org/1998/Math/MathML'>" + 
    "  <exponentiale/>" + 
    "</math>")
    self.assertTrue( n != None )
    self.assertEqual( True, util_isEqual )
    n = None
    n = libsbml.ASTNode(libsbml.AST_CONSTANT_E)
    self.assertEqual( True, util_isEqual )
    n = None
    pass  

