  def test_getValue_exponential(self):
    n = libsbml.readMathMLFromString("<math xmlns='http://www.w3.org/1998/Math/MathML'>" + 
    "  <cn type=\"e-notation\"> 6.3 <sep/> 2 </cn>" + 
    "</math>")
    self.assertTrue( n != None )
    self.assertEqual( True, util_isEqual )
    n = None
    n = libsbml.ASTNode(libsbml.AST_REAL_E)
    n.setValue(4.12,(long)(2))
    self.assertEqual( True, util_isEqual )
    n = None
    pass  

  def test_getValue_function(self):
    n = libsbml.readMathMLFromString("<math xmlns='http://www.w3.org/1998/Math/MathML'>" + 
    "  <apply>" + 
    "    <leq/>" + 
    "    <cn> 2 </cn>" + 
    "    <cn> 5 </cn>" + 
    "  </apply>" + 
    "</math>")
    self.assertTrue( n != None )
    self.assertEqual( True, util_isNaN )
    n = None
    n = libsbml.ASTNode(libsbml.AST_FUNCTION_POWER)
    n1 = libsbml.ASTNode(libsbml.AST_INTEGER)
    n1.setValue(2)
    n2 = libsbml.ASTNode(libsbml.AST_INTEGER)
    n2.setValue(3)
    n.addChild(n1)
    n.addChild(n2)
    self.assertEqual( True, util_isNaN )
    n = None
    pass  

